//styles
import "./Login.scss"

//react
import { InputText } from 'primereact/inputtext';
import { Password } from 'primereact/password';
import { Button } from 'primereact/button';
import {} from 'react-router-dom'

const Login = () => {
    return (
        <Form noValidate method="post" className="loginC">
            <div className="login">
                <h3>Inicio de Sesión</h3>
                {/* {data?.length ?
                    <p className="error">{data[0]}</p>
                    : <p className="error"></p>} */}
                <div className="input">
                    <label>Usuario</label>
                    <InputText name="username" placeholder="Usuario" />
                </div>
                <div className="input">
                    <label>Contraseña</label>
                    <Password name="password" placeholder="Contraseña" feedback={false} />
                </div>
                <div className="button">
                    <Button label="Ingresar" severity="secondary" type='submit' />
                </div>
            </div>
        </Form>
    )
}

export default Login
